SELECT name
FROM shop_product
WHERE photo = FALSE;

SELECT name
FROM shop_product
WHERE photo = '';

SELECT avg(price) AS "Average Price"
FROM shop_product
/*WHERE photo != ''*/

SELECT count(user_id) AS "No. customers"
where user_id != ''
FROM shop_impression;

SELECT count(user_id) AS "No. customers"
where user_id > 0
FROM shop_impression;

SELECT count(id) AS "No. customers"
where user_id > 0
FROM shop_impression;

SELECT count(id) AS "No. customers"
FROM shop_impression
WHERE user_id > 0;

SELECT count(user_id) AS "No. customers"
FROM shop_impression
WHERE user_id > 0;

SELECT count(user_id) AS "No. customers"
FROM shop_impression
WHERE user_id IS NOT NULL;

SELECT count(id) AS "No. customers"
FROM shop_impression
WHERE user_id IS NOT NULL;

SELECT product_id AS "Product",
       COUNT(id) AS "Total Orders"
FROM shop_orderitem;

SELECT product_id, sum(quantity) AS "Total Units"
FROM shop_orderitem
Group by product_id;

SELECT product.name,
       product.price
FROM shop_product AS product
WHERE product.id IN {
  SELECT impression.product_id
  FROM shop_impression AS impression }
AND product.id NOT IN {
SELECT orders.product_id
FROM shop_orderitem AS orders}

